import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Cars() {
    const [cars, setCars] = useState([]);

    console.log('API URL:', process.env.REACT_APP_API_URL);


    useEffect(() => {
        const fetchCars = async () => {
            try {
                const response = await axios.get(process.env.REACT_APP_API_URL + '/car_info');
                console.log(response.data);
                setCars(response.data);
            } catch (error) {
                console.error('Error fetching cars:', error);
            }
        };

        fetchCars();
    }, []);

    return (
        <div>
            <h2>Cars</h2>
            {cars.map((car, index) => (
                <div key={index}>
                    <img src={car.image} alt={`${car.make} ${car.model}`} />
                    {car.make} {car.model} - Exterior Color: {car.exterior_color} - Interior Color: {car.interior_color} - VIN: {car.vin} - Fuel: {car.fuel} - Year: {car.year} - List Time: {car.list_time} - List Price: ${car.list_price} - Current Mileage: {car.current_mileage} miles
                </div>
            ))}
        </div>
    );
}

export default Cars;
